script: |
  super -f text -I q5970.spq | sort > q5970.out

inputs:
  - name: q5970.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT 8 + + 51 NOT BETWEEN - col2 AND - col0 / - 62 + col1 * col0;
  - name: tab1

outputs:
  - name: q5970.out
    data: |
      51
      85
      91
